import React, { Component } from "react";
import * as TagNames from "../constants/constants";
import axios from "axios";
import Movies from "../common/movies";
// import { GetJSON } from "../common/getjson";

class Home extends Component {
  state = {
    movies: [],
  };

  async componentDidMount() {
    if (this.state.movies.length < 1) {
      const { data: movies } = await axios.get(TagNames.getURL());
      this.setState({ movies });
    }
    // with fetchAPI -     const data = GetJSON(url);
    // console.log("URL: " + url);
    console.log("home.jsx- movies length-" + this.state.movies.length);
  }

  render() {
    const { results } = this.state.movies;
    return (
      <>
        <h1>Home</h1>
        <Movies data={results} />
      </>
    );
  }
}

export default Home;
